import styled from "styled-components/macro";

export const HeaderWrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #1e1e1e;
  height: 4rem;
`;

export const HeaderImage = styled.img`
  max-width: 3rem;
  object-fit: cover;
`;

export const HeaderTitle = styled.h2`
  color: #ffffff;
`;
